import React from 'react';
import {UserContext, UserProvider} from "./User";
import {DomainContext, DomainProvider} from "./Domain";
import {ModelContext, ModelProvider} from "./Model";
import {BrowserContext, BrowserProvider} from "./Browser";
export function DefaultProviders(props) {
    return <UserProvider>
        <DomainProvider>
            <ModelProvider>
                {props.children}
            </ModelProvider>
        </DomainProvider>
    </UserProvider>;
}

export {UserContext, DomainContext, ModelContext, BrowserContext};
export {UserProvider, DomainProvider, ModelProvider, BrowserProvider};
